let logD = console.log;

function c16to12(col) {
  logD(`got ${col.toString(16)}`);
  let r1=col >> 12, g1 = (col >> 7 ) &0xf, b1 = (col >> 1)& 0xf;  
  let res = (r1 << 8) + (g1 << 4) + b1;
  logD(`returning ${res.toString(16)}`);
  return( res);
}

